            "type": "string"
          },
          "namespaceType": {
            "description": "Type of the namespace reported. It can be hash or plain, depending on various\nfactors.",
            "enum": [
              "Plain",
              "Hash"
            ],
            "readOnly": true
          },
          "probeID": {
            "description": "The ID of the probe. Only applicable when the remote controller is empty.",
